import React from 'react';
import NavBar from "./Components/NavBar"
import Routes from "./Components/Routes/Routes"
import Footer from "./Components/Footer"

function App() {
  return (
    <React.Fragment>
      <NavBar />
      <Routes />
      <Footer />
    </React.Fragment>
  );
}

export default App;
